--- @param current number
--- @param target number
--- @param inc number
--- @param dec number
--- @return number
function approach_f32(current, target, inc, dec)
    if current < target then
        current = current + inc
        if current > target then
            current = target
        end
    else
        current = current - dec
        if current < target then
            current = target
        end
    end
    return current
end

--- @param current integer
--- @param target integer
--- @param inc integer
--- @param dec integer
--- @return integer
function approach_s32(current, target, inc, dec)
    if current < target then
        current = current + inc
        if current > target then
            current = target
        end
    else
        current = current - dec
        if current < target then
            current = target
        end
    end

    -- keep within 32 bits
    if current > 2147483647 then
        current = -2147483648 + (current - 2147483647)
    elseif current < -2147483648 then
        current = 2147483647 + (current - (-2147483648))
    end
    return current
end


